// src/pages/HomePage.js
import React from 'react';
import Slider from '../components/Slider';
import CardSection from '../components/CardSection';
import Card from '../components/Card';
import './HomePage.css';

const HomePage = () => {
  const categories = [
    { id: 1, name: 'Treadmill', image: '/images/img.jpg' },
    { id: 2, name: 'Stationary Bike', image: '/images/img.jpg' },
    { id: 3, name: 'Rowing Machine', image: '/images/img.jpg' },
    { id: 4, name: 'Stair Climber', image: '/images/img.jpg' },
    { id: 5, name: 'Dumbbells', image: '/images/img.jpg' },
    { id: 6, name: 'Barbells', image: '/images/img.jpg' },
    { id: 7, name: 'Leg Press Machine', image: '/images/img.jpg' },
    { id: 8, name: 'Chest Press Machine', image: '/images/img.jpg' },
  ];

  const cardsData = [
    { image: '/images/img.jpg', title: 'Cardio Machines'},
    { image: '/images/img.jpg', title: 'Strength Training Equipment'},
    { image: '/images/img.jpg', title: 'Functional Training Equipment'},
    { image: '/images/img.jpg', title: 'Flexibility and Recovery Equipment'},
  ];

  return (
    <div className="home-page">
      <Slider />
      <CardSection heading="Best Sellers" link="/best-sellers" />
      <div className="card-section">
        {cardsData.map((card, index) => (
          <Card key={index} image={card.image} title={card.title} description={card.description} />
        ))}
      </div>
      <CardSection heading="New Sellers" link="/new-sellers" />
      <div className="card-section">
        {cardsData.map((card, index) => (
          <Card key={index} image={card.image} title={card.title} description={card.description} />
        ))}
      </div>
      <CardSection heading="Shop More" link="/" />
      <div className="categories-section">
        {categories.map((category) => (
          <div key={category.id} className="category-card">
            <img src={category.image} alt={category.name} />
            <h3>{category.name}</h3>
            <p>Shop Now</p>
          </div>
        ))}
      </div>
    </div>
  );
};

export default HomePage;
